{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 4-pole Band Splitter\par}
{\pard \ql \f0 \sa180 \li0 \fi0 4-pole band splitter that preserves phase between the bands. It has a UI and uses much steeper crossover filters (24 dB/oct) than the default that ships with Reaper thereby providing sharper band transitions. It also has an option for linear phase FIR crossovers instead of the default IIR filters. IIRs cost less CPU and introduce no preringing or latency. The linear phase FIRs however prevent phase distortion (which can be important in some mixing settings), but introduce latency compensation. Note that when using the linear phase filters, it is not recommended to modulate the crossover frequencies as this introduces crackles. {\field{\*\fldinst{HYPERLINK "https://i.imgur.com/nOhiaJB.png"}}{\fldrslt{\ul
Screenshot
}}}
\par}
