{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 A basic stereo widener\par}
{\pard \ql \f0 \sa180 \li0 \fi0 A fairly basic stereo widening tool. Widens the sound, but makes sure that the mono-mix stays unaffected (unlike Haas). The crossover is basically a 12 pole HPF that cuts the bass of the widening to avoid widening the bass too much. The last slider allows you to mix in the original side channel (which can optionally also be run through the 12-pole highpass). You can either add stereo sound from nothing, using the Strength slider. This adds a comb filtered version of the average signal with opposite polarity to the different channels. Be careful not to overdo it, or you get a flangey sound (unless that is what you want). You can manipulate the existing side channel that's in the input. The gain of the original side channel is scaled by the old "Old side" knob. Depending on the button "HP original side" this signal route will be highpassed (mono-izing the low frequencies). {\field{\*\fldinst{HYPERLINK "https://i.imgur.com/a09HF51.png"}}{\fldrslt{\ul
Screenshot
}}}
\par}
