{\pard \ql \f0 \sa180 \li0 \fi0 You can find demos of the plugin {\field{\*\fldinst{HYPERLINK "https://www.youtube.com/watch?v=47L9bysgIiA"}}{\fldrslt{\ul
here
}}}
 and {\field{\*\fldinst{HYPERLINK "https://www.youtube.com/watch?v=pUu3h21yARY"}}{\fldrslt{\ul
here
}}}
.\par}
