{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 A plugin to manipulate audio phase in a frequency dependent manner\par}
{\pard \ql \f0 \sa180 \li0 \fi0 This plugin can be used to shift the phase of audio in a frequency dependent manner. One can draw a phase distortion using a spline. This distortion can be modulated by scaling the amount of phase distortion.\par}
{\pard \ql \f0 \sa180 \li0 \fi0 The plugin has a number of modes of operation. Linked - Left and right are distorted according to the same shape. Opposite - Left and right are phase shifted in an opposite manner. Good for making whoosy laser-like sounds, but can lead to loss of mono compatiblity. Mono-Opposite - This mode works like opposite, but computes the changes applied to the left and right channel and adds an opposite change to the other channel. This serves more as a widener.\par}
{\pard \ql \f0 \sa180 \li0 \fi0 This plugin operates using an STFT. Sharp phase transitions can lead to a loss of allpass response.\par}
}

